import React from 'react';
import './drawerStories.css';
import { BrowserRouter, Route, Link,Switch } from 'react-router-dom';

export const DrawerStories = () =>{
	return(
		<div className="drawerStories">
			<ul className="drawer-stories-list">
				<li className="drawer-stories-list-li"><Link  to='/canon'>{/*<Icon  size={30} iconName="books"/>*/}Canon</Link></li>
				<li className="drawer-stories-list-li"><Link  to='/legends'>{/*<Icon size={30} iconName="circuit"/>*/}Legends</Link></li>
			</ul>
		</div>
);
}
